import React from 'react';

class Type extends React.Component{
    render(){
        return (
            <div>
                <button onClick={this.sortByPriceAsc}>
            Aflopend
            </button>
            <button onClick={this.sortByPriceDesc}>
            Oplopend
            </button>
                {this.props.type}
            </div>  
        )
    }
}


export default Type;
